import React from 'react';
import '//vjs.zencdn.net/8.3.0/video-js.min.css';
import '//vjs.zencdn.net/8.3.0/video.min.js';

function App() {
  const videoJsOptions = {
    autoplay: true,
    controls: true,
    sources: [{
      src: 'http://localhost:1935/live/test/index.m3u8',
      type: 'application/x-mpegURL'
    }]
  };

  return (
    <div>
            <h1>RTMP Player</h1>

      <VideoPlayer { ...videoJsOptions } />
    </div>
  );
}

export default App;
